    true,nt"url": null,nt"notes": "This X-ray transition table provides the
    energies and wavelengths for the K and L transitions connecting energy levels having
    principal quantum numbers n = 1, 2, 3, and 4. The elements covered include Z = 10,
    neon to Z = 100, fermium. There are two unique features of this database: (1) all
    experimental values are on a scale consistent with the International System of measurement
    (the SI) and the numerical values are determined using constants from the Recommended
    Values of the Fundamental Physical Constants: 1998 [115] and (2) accurate theoretical
    estimates are included for all transitions.  Version 1.2",nt"license_title":
